/* Fixed Data in ROM - Field and Curve parameters */

package amcl

type Chunk int64

/* First the 32/64-bit dependent BIG code */
/* Note that because of the lack of a 128-bit integer, 32 and 64-bit code needs to be done differently */

func pexceed(a *BIG, b *BIG) bool {
	ea := EXCESS(a)
	eb := EXCESS(b)
	if (ea + 1) > FEXCESS/(eb+1) {
		return true
	}
	return false
}

func sexceed(a *BIG) bool {
	ea := EXCESS(a)
	if (ea + 1) > FEXCESS/(ea+1) {
		return true
	}
	return false
}

func ff_pexceed(a *BIG, b *BIG) bool {
	ea := FF_EXCESS(a)
	eb := FF_EXCESS(b)
	if (ea + 1) > P_FEXCESS/(eb+1) {
		return true
	}
	return false
}

func ff_sexceed(a *BIG) bool {
	ea := FF_EXCESS(a)
	if (ea + 1) > P_FEXCESS/(ea+1) {
		return true
	}
	return false
}

/* return a*b as DBIG */
func mul(a *BIG, b *BIG) *DBIG {
	c := NewDBIG()
	carry := Chunk(0)
	//	a.norm()
	//	b.norm()

	for i := 0; i < NLEN; i++ {
		carry = 0
		for j := 0; j < NLEN; j++ {
			carry, c.w[i+j] = muladd(a.w[i], b.w[j], carry, c.w[i+j])
			//carry=c.muladd(a.w[i],b.w[j],carry,i+j)
		}
		c.w[NLEN+i] = carry
	}

	return c
}

/* return a^2 as DBIG */
func sqr(a *BIG) *DBIG {
	c := NewDBIG()
	carry := Chunk(0)
	//	a.norm()
	for i := 0; i < NLEN; i++ {
		carry = 0
		for j := i + 1; j < NLEN; j++ {
			carry, c.w[i+j] = muladd(2*a.w[i], a.w[j], carry, c.w[i+j])
			//carry=c.muladd(2*a.w[i],a.w[j],carry,i+j)
		}
		c.w[NLEN+i] = carry
	}

	for i := 0; i < NLEN; i++ {
		top, bot := muladd(a.w[i], a.w[i], 0, c.w[2*i])
		c.w[2*i] = bot
		c.w[2*i+1] += top
		//c.w[2*i+1]+=c.muladd(a.w[i],a.w[i],0,2*i)

	}
	c.norm()
	return c
}

func monty(d *DBIG) *BIG {
	md := NewBIGints(Modulus)
	carry := Chunk(0)
	m := Chunk(0)
	for i := 0; i < NLEN; i++ {
		if MConst == -1 {
			m = (-d.w[i]) & BMASK
		} else {
			if MConst == 1 {
				m = d.w[i]
			} else {
				m = (MConst * d.w[i]) & BMASK
			}
		}

		carry = 0
		for j := 0; j < NLEN; j++ {
			carry, d.w[i+j] = muladd(m, md.w[j], carry, d.w[i+j])
			//carry=d.muladd(m,md.w[j],carry,i+j)
		}
		d.w[NLEN+i] += carry
	}

	b := NewBIG()
	for i := 0; i < NLEN; i++ {
		b.w[i] = d.w[NLEN+i]
	}
	b.norm()
	return b
}

/* set this[i]+=x*y+c, and return high part */
func muladd(a Chunk, b Chunk, c Chunk, r Chunk) (Chunk, Chunk) {
	x0 := a & HMASK
	x1 := (a >> HBITS)
	y0 := b & HMASK
	y1 := (b >> HBITS)
	bot := x0 * y0
	top := x1 * y1
	mid := x0*y1 + x1*y0
	x0 = mid & HMASK
	x1 = (mid >> HBITS)
	bot += x0 << HBITS
	bot += c
	bot += r
	top += x1
	carry := bot >> BASEBITS
	bot &= BMASK
	top += carry
	return top, bot
}

